import { Map } from "leaflet";
import React from "react";
import { MapContainer, TileLayer } from "react-leaflet";

const Header = () => {
  return (
    <div className="flight-Header">
      <nav>
        <ul>
          <li>Flight Watch</li>
        </ul>
      </nav>
    </div>
  );
};

export default Header;
